<!DOCTYPE html>
<html>
<head>
    <title>Queue</title>
    <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.6.1/jquery.min.js"></script>
</head>
<body>

<h2>Queue Example</h2>

<div id="queue"></div>

<script>
$(document).ready(function(){
    var items = ["apple", "banana", "cherry", "date", "elderberry"];
    
    function enqueue(item) {
        $("#queue").append(item);
    }
    
    function dequeue() {
        var item = $("#queue").find("li");
        
        if (item.length > 0) {
            item.remove();
        }
        
        $("#queue").empty();
    }
    
    enqueue("apple");
    enqueue("banana");
    enqueue("cherry");
   enqueue("date");
    enqueue("elderberry");
    
    dequeue();
});
</script>

</body>
</html>
